1	1235	She packed my bags last night pre-flight \r\nZero hour nine A.M. \r\nAnd I'm gonna be high as a kite by then\r\n\r\nI miss the earth so much, I miss my wife \r\nIt's lonely out in space \r\nOn such a timeless flight\r\n\r\nAnd I think it's gonna be a long long time \r\n'Til touchdown brings me 'round again to find \r\nI'm not the man they think I am at home \r\nOh, no, no, no. \r\nI'm a rocket man \r\nRocket man burning out his fuse up here alone\r\n\r\nAnd I think it's gonna be a long long time \r\n'Til touchdown brings me 'round again to find \r\nI'm not the man they think I am at home \r\nOh, no, no, no. \r\nI'm a rocket man \r\nRocket man burning out his fuse up here alone\r\n\r\nMars ain't the kind of place to raise your kids \r\nIn fact it's cold as hell \r\nAnd there's no one there to raise them if you did\r\n\r\nAnd all this science I don't understand \r\nIt's just my job five days a week \r\nA rocket man, a rocket man\r\n\r\nAnd I think it's gonna be a long long time \r\n'Til touchdown brings me 'round again to find \r\nI'm not the man they think I am at home \r\nOh, no, no, no. \r\nI'm a rocket man \r\nRocket man burning out his fuse up here alone\r\n\r\nAnd I think it's gonna be a long long time \r\n'Til touchdown brings me 'round again to find \r\nI'm not the man they think I am at home \r\nOh, no, no, no. \r\nI'm a rocket man \r\nRocket man burning out his fuse up here alone\r\n\r\nAnd I think it's gonna be a long long time...	2018-03-28 16:13:14.653028	2018-03-28 16:13:14.653028
2	1260	No one in the world \r\nEver had a love as sweet as my love \r\nFor nowhere in the wolrd \r\nCould there be a boy as true as you love\r\n\r\nAll my love \r\nI give gladly to you \r\nAll your love \r\nYou give gladly to me \r\nTell me why then \r\nOh why should it be that\r\n\r\nWe go on hurting each other \r\nWe go on hurting each other \r\nMaking each other cry \r\nHurting each other \r\nWithout ever knowing why\r\n\r\nCloser than the leaves \r\nOn a weepin' willow baby we are \r\nCloser dear are we \r\nThan the simple letters "A" and "B" are\r\n\r\nAll my life \r\nI could love only you \r\nAll your life \r\nYou could love only me \r\nTell me why than \r\nOh why should it be that\r\n\r\nWe go on hurting each other \r\nWe go on hurting each other \r\nMaking each other cry \r\nHurting each other \r\nWithout ever knowing why\r\n\r\nCan't we stop hurting each other \r\nGotta stop hurting each other \r\nMaking each other cry \r\nBreaking each other's heart \r\nTearing each other apart	2018-03-28 16:19:36.353542	2018-03-28 16:19:36.353542
3	1199	No I can't forget this evening \r\nOr your face as you were leaving \r\nBut I guess that's just the way \r\nThe story goes\r\n\r\nYou always smile but in your eyes your sorrow shows \r\nYes it shows\r\n\r\nNo I can't forget tomorrow \r\nWhen I think of all my sorrow \r\nWhen I had you there \r\nBut then I let you go\r\n\r\nAnd now it's only fair that I should let you know what you should know\r\n\r\nI can't live \r\nIf living is without you \r\nI can't live \r\nI can't give anymore \r\nCan't live \r\nIf living is without you \r\nI can't give \r\nI can't give anymore\r\n\r\nWell I can't forget this evening \r\nOr your face as you were leaving \r\nBut I guess that's just the way \r\nThe story goes\r\n\r\nYou always smile but in your eyes your sorrow shows \r\nYes it shows\r\n\r\nI can't live \r\nIf living is without you \r\nI can't live \r\nI can't give anymore \r\nCan't live \r\nIf living is without you \r\nI can't live \r\nI can't give anymore\r\n\r\nCan't live \r\nOh I can't live \r\nNo no no no\r\n\r\nI can't live \r\nOh can't live \r\nLiving is without you \r\nOh I can't live \r\nI can't live \r\nI can't give anymore\r\n\r\nOh can't live \r\nOh I can't live \r\nNo no no I	2018-03-28 16:23:50.373255	2018-03-28 16:23:50.373255
